// frontend/src/pages/HomePages.js (Note: Your file is named HomePages.js, not HomePage.js)
import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // <--- NEW IMPORT: Link to new CSS file
// You might need to import your book icon here if it's a local SVG/PNG
// import BookIcon from '../assests/book-icon.svg'; // Example if you have a local icon

function HomePages() {
  return (
    <div className="landing-page-container">
      <div className="landing-content">
        <div className="book-icon-wrapper">
          {/* Replace with your actual book icon image or Font Awesome icon */}
          {/* If you have a local image: <img src={BookIcon} alt="Book Icon" className="book-icon" /> */}
          <i className="fas fa-book-open book-icon"></i> {/* Example: Font Awesome book icon */}
        </div>
        <h1 className="welcome-heading">Welcome to SwapShelf</h1>
        <p className="landing-description">
          Discover, share, and borrow books from our community library. Connect with fellow readers and expand your literary horizons.
        </p>
        <div className="auth-buttons">
          <Link to="/login" className="btn btn-login-landing">Login</Link>
          <Link to="/register" className="btn btn-register-landing">Register</Link>
        </div>
      </div>
      <div className="landing-image-section">
        {/* The background image of books will be handled via CSS */}
        {/* Or, if the image is part of the HTML content, you'd place it here: */}
        {/* <img src={yourBookShelfImage} alt="Bookshelf" className="bookshelf-image" /> */}
      </div>
    </div>
  );
}

export default HomePages;
